import axios from "axios";

export function Extract() {
  function modify(d) {
    console.log("reached");
    d = [1, 2, 3];
  }
  let d = [];
  axios
    .get("http://7f528d0c0908.ngrok.io/covid19_patient_monitor/get_info", {
      params: {
        a_id: "ADMIN123",
      },
    })
    .then((res) => {
      //console.log("api response ", res.data.patients);
      // response = res.data.patients;
      console.log("d before ", d);
      modify(d);
      console.log("d after ", d);
      //console.log("response ", response);
      // console.log("state= ", apiData);
    })
    .catch((err) => console.log("error ", err));
  return d;
}
